  `product_count` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '产品数量',
  `brand_company_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '品牌商ID',
  `big_pic` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '专区大图',
  `store_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '所属店铺',
  `status` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '状态：1启用 2停用',
  `sort` smallint(3) UNSIGNED NOT NULL DEFAULT 125 COMMENT '排序号',
