-- ----------------------------
-- Table structure for pms_product
-- ----------------------------
DROP TABLE IF EXISTS `pms_product`;
CREATE TABLE `pms_product`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `product_category_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品分类ID',
  `product_category_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品分类名称',
  `product_attribute_category_id` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '商品属性分类ID',
  `product_title` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '商品标题',
  `product_sub_title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '商品副标题',
  `product_info` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品简介',
  `product_tags` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品标签',
  `brand_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '品牌ID',
  `brand_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '品牌名称',
  `cover` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '商品封面',
  `image` varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品图片,连产品图片限制为5张，以逗号分割',
  `video` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '主图视频链接',
  `is_hot` tinyint(1) UNSIGNED NOT NULL DEFAULT 2 COMMENT '是否热卖：1是 2否',
  `is_recommand` tinyint(1) UNSIGNED NOT NULL DEFAULT 2 COMMENT '是否推荐：1是 2否',
  `is_new` tinyint(1) UNSIGNED NOT NULL DEFAULT 2 COMMENT '是否新品：1是 2否',
  `is_preview` tinyint(1) UNSIGNED NOT NULL DEFAULT 2 COMMENT '预告商品：1是 2否',
  `verify_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 2 COMMENT '审核状态：1已审核 2待审核',
  `status` tinyint(1) UNSIGNED NOT NULL DEFAULT 2 COMMENT '上架状态：1已上架 2已下架',
  `sort` smallint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '排序号',
  `sales` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '销量',
  `price` decimal(8, 2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品售价（单位 元）',
  `gift_growth` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '赠送的成长值',
  `gift_integral` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '赠送的积分',
  `use_integral_limit` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '限制使用的积分数',
  `cost_price` decimal(8, 2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '成本价(单位 元)',
  `original_price` decimal(8, 2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '市场价',
  `stock` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '库存',
  `low_stock` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '库存预警值',
  `unit` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '计量单位',
  `product_sn` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品编号',
  `volume` decimal(8, 2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '体积(m³)',
  `weight` decimal(8, 2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '重量(KG)',
  `service` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '产品服务：1无忧退货 2快速退款 3免费包邮',
  `keywords` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '关键词',
  `note` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品备注',
  `promotion_start_time` datetime(0) NULL DEFAULT NULL COMMENT '促销开始时间',
  `promotion_end_time` datetime(0) NULL DEFAULT NULL COMMENT '促销结束时间',
  `promotion_price` decimal(10, 2) UNSIGNED NULL DEFAULT 0 COMMENT '促销价格',
  `promotion_per_limit` int(11) NULL DEFAULT NULL COMMENT '活动限购数量',
  `promotion_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '促销类型：0无优惠 1特惠促销价 2会员价 3阶梯价格 4满减价格',
  `is_postage` tinyint(1) UNSIGNED NOT NULL DEFAULT 2 COMMENT '是否包邮：1是 2否',
  `postage` decimal(8, 2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '邮费(单位 元)',
  `feight_template_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '运费模板ID',
  `browse` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '浏览量',
  `store_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '所属店铺ID',
  `create_user` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '添加人',
  `create_time` datetime(0) NOT NULL COMMENT '添加时间',
  `update_user` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '更新人',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `mark` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '有效标识(1正常 0删除)',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `product_title`(`product_title`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商品表' ROW_FORMAT = Compact;

