INSERT INTO `cms_article` VALUES (1, '青春中最多的是那些奋斗的身影', '/images/article/20211020/20211020162940941.jpg', 1, 2, 0, 1, '没有顾虑，仅有遐想，这可能是青春最大的特点了。在此阶段，我们曾对自我迷恋的某人疯狂的追求过，以往为自我的梦想呐喊过，也对世间的教条挣扎过……一切令人费解，不可思议的事在此阶段做起来都如随风飞舞的落叶，顺其自然，不在意结果如何。然而，时光在永不停息的穿梭着，完美的青春年华总在不经意间逝去，留下的仅有几抹划痕。', '/images/article/20211020/20211020163023795.jpg,/images/article/20211020/2021102016302343.jpg,/images/article/20211020/20211020163023559.jpg,/images/article/20211020/2021102016302362.jpg,/images/article/20211020/20211020163023365.jpg', '<p>\n	在这浮华的尘世中，青春，这两个字背后所隐藏的故事可能是身心疲惫的我们所能感受到的唯一的一丝慰藉了。曾今的年华，都经不起时间的冲刷;如今的我们，仅有缅怀这份珍贵的记忆来理顺心头的愁丝。\n</p>\n<p align=\"center\">\n	<img src=\"/images/article/20211020/20211020163052266.jpg\" alt=\"\" />\n</p>\n<p>\n	&emsp;&emsp;没有顾虑，仅有遐想，这可能是青春最大的特点了。在此阶段，我们曾对自我迷恋的某人疯狂的追求过，以往为自我的梦想呐喊过，也对世间的教条挣扎过……一切令人费解，不可思议的事在此阶段做起来都如随风飞舞的落叶，顺其自然，不在意结果如何。然而，时光在永不停息的穿梭着，完美的青春年华总在不经意间逝去，留下的仅有几抹划痕。\n</p>\n<p>\n	&emsp;&emsp;青春中的感情，我认为正如徐志摩老先生所说：人这一生，至少该有一次，为了某个人而忘了自我的存在。不求有结果，不求同行，不求曾今拥有，甚至不求她爱我，只求在我最灿烂的年华里，遇见你。的确啊!感情是青涩的，无论结果如何，只要曾今在自我的内心有划过深深的痕迹，足矣。\n</p>\n<p>\n	&emsp;&emsp;青春中难免会有迷惘，也许年轻的我们尚不知自我所追求的是什么，可能内心仅有一个如泡影般炫彩的幻想，整天忙忙碌碌的不让自我停下来，为的可能就是简单的让自我的心灵得到一丝慰藉，其实殊不知，我们正在挥霍青春，对于未来，可能只是一片可怕的空白，如同被洪水淹没了的世界。\n</p>\n<p>\n	&emsp;&emsp;青春中最多的是那些奋斗的身影，这是一个充满活力，充满动力的阶段，可能你自身的才华在此能发挥的淋漓尽致，为你铸造将来辉煌的人生打下坚实的基础。毫无疑问这样的旅途注定是孤独的、艰辛的，更有可能遭受他人百般的误解，对此，你唯有缄口不言。泰然处之，不必在意他人的眼神，因为仅有你自我才清楚，自我所想得到的是什么。\n</p>\n<p>\n	&emsp;&emsp;郭敬明曾今说过：一恍惚，一刹那，我们就这样垂垂老去。的确，青春易逝，也许仅有当我们真正失去时，我们才能体会到，可到那时唯有追悔莫及。罢了罢了，也许每个人对青春的感受都不一样吧!将来如何全看你在此阶段如何把握了。\n</p>\n<p>\n	&emsp;&emsp;“每一个不曾起舞的日子，都是对生命的辜负”的确，青春是用来绽放的，不是用来虚度的。所以，请珍视青春，珍视拥有的此刻，在一切都还未晚的时候，尽可能的留下属于自我的所有。\n</p>', 1, 1, '2021-10-20 16:30:58', 0, NULL, 1);
INSERT INTO `pms_brand` VALUES (1, '测试品牌', '/images/brand/20211025/20211025133805384.jpg', '测试品牌', 'M', 1209, 1001037, '/images/brand/20211025/20211025133808428.jpg', 1, 1, 125, 1, '2020-05-05 12:24:53', 1, '2021-10-25 13:38:17', 1);
INSERT INTO `pms_brand_company` VALUES (1001000, 'MUJI制造商', '严选精选了MUJI制造商和生产原料，\n用几乎零利润的价格，剔除品牌溢价，\n让用户享受原品牌的品质生活。', '/images/brandcompany/20211025/20211025133513985.jpg', 2, 1, '2020-05-05 10:43:35', 1, '2021-01-29 13:18:22', 1);
INSERT INTO `pms_brand_company` VALUES (1001002, '内野制造商', '严选从世界各地挑选毛巾，最终选择了为日本内野代工的工厂，追求毛巾的柔软度与功能性。品质比肩商场几百元的毛巾。', '/images/brandcompany/20211025/20211025133513985.jpg', 10, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:55:24', 1);
INSERT INTO `pms_brand_company` VALUES (1001003, 'Adidas制造商', '严选找到为Adidas等品牌制造商，\n选取优质原材料，与厂方一起设计，\n为你提供好的理想的运动装备。', '/images/brandcompany/20211025/20211025133513985.jpg', 30, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:55:26', 1);
INSERT INTO `pms_brand_company` VALUES (1001007, '优衣库制造商', '严选找到日本知名服装UNIQLO的制造商，\n选取优质长绒棉和精梳工艺，\n与厂方一起设计，为你提供理想的棉袜。', '/images/brandcompany/20211025/20211025133513985.jpg', 12, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:55:28', 1);
INSERT INTO `pms_brand_company` VALUES (1001008, '膳魔师制造商', '严选深入保温行业内部，\n找到德国膳魔师制造商的代工厂。\n同样的品质，却有更优的价格。', '/images/brandcompany/20211025/20211025133513985.jpg', 40, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:55:30', 1);
INSERT INTO `pms_brand_company` VALUES (1001010, '星巴克制造商', '严选寻访全国保温杯制造企业，\n最终找到高端咖啡品牌星巴克的制造商，\n专注保温杯生产20年，品质与颜值兼备。', '/images/brandcompany/20211025/20211025133513985.jpg', 34, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:56:09', 1);
INSERT INTO `pms_brand_company` VALUES (1001012, 'Wedgwood制造商', '严选寻访英国皇室御用陶瓷Wedgwood制造商，\n制模到成品，历经25道工序、7次检验、3次烧制，\n你看不见的地方，我们也在坚持。', '/images/brandcompany/20211025/20211025133513985.jpg', 21, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:56:13', 1);
INSERT INTO `pms_brand_company` VALUES (1001013, 'Royal Doulton制造商', '严选深入英国最大骨瓷品牌Royal Doulton制造商， \n顶级英国瓷器的代名词，广受世界皇室喜爱。\n每件瓷器，都有自己的故事。', '/images/brandcompany/20211025/20211025133513985.jpg', 47, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:55:06', 1);
INSERT INTO `pms_brand_company` VALUES (1001015, '日本KEYUCA制造商', 'KEYUCA是日本餐具及料理用具品牌，\n遵循极简原木风，高端餐具体验。\n严选的餐具正是来自这一品牌制造商。', '/images/brandcompany/20211025/20211025133513985.jpg', 49, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:55:03', 1);
INSERT INTO `pms_brand_company` VALUES (1001016, '爱慕制造商', '150家样品比对筛选，20家工厂深入走访，\n严选最终选定高端内衣爱慕制造商，\n20年品质保证，为你打造天然舒适的衣物。', '/images/brandcompany/20211025/20211025133513985.jpg', 9, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:50', 1);
INSERT INTO `pms_brand_company` VALUES (1001020, 'Ralph Lauren制造商', '我们与Ralph Lauren Home的制造商成功接洽，掌握先进的生产设备，传承品牌工艺和工序。追求生活品质的你，值得拥有。', '/images/brandcompany/20211025/20211025133513985.jpg', 20, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:47', 1);
INSERT INTO `pms_brand_company` VALUES (1001037, '新秀丽制造商', '严选为制作品质与颜值兼具的箱包，\n选定新秀丽、CK、Ricardo等品牌合作的制造商，\n拥有国内先进流水线20余条，实力保障品质。', '/images/brandcompany/20211025/20211025133513985.jpg', 5, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:45', 1);
INSERT INTO `pms_brand_company` VALUES (1001038, 'Coach制造商', '严选为制作高品质高颜值皮具配件，\n由Coach、MK等品牌制造商生产，\n由严选360度全程监制，给你带来优质皮具。', '/images/brandcompany/20211025/20211025133513985.jpg', 3, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:42', 1);
INSERT INTO `pms_brand_company` VALUES (1001039, 'MK制造商', '严选为制造高品质的皮具，\n选择Michael Kors品牌合作的制造工厂，\n18年专业皮具生产经验，手工至美，品质保证。', '/images/brandcompany/20211025/20211025133513985.jpg', 17, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:39', 1);
INSERT INTO `pms_brand_company` VALUES (1001045, '罗莱制造商', '严选团队为打造吸湿透气柔软的蚕丝被，\n从蚕茧原材到温感性能，多次甄选测试\n选择罗莱制造商工厂，手工处理，优质舒适。', '/images/brandcompany/20211025/20211025133513985.jpg', 45, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:37', 1);
INSERT INTO `pms_brand_company` VALUES (1003000, 'Carters制造商', '来自Carters大牌代工厂生产，\n严选纯天然材料，无荧光不添加，\nITS安心标志权威检测，安全护航。', '/images/brandcompany/20211025/20211025133513985.jpg', 41, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:52', 1);
INSERT INTO `pms_brand_company` VALUES (1005001, 'Goody制造商', '严选深入美国百年发饰品牌Goody制造商，\n确保每把梳子做工精湛，养护头皮。\n戴安娜王妃的最爱，你也能拥有。', '/images/brandcompany/20211025/20211025133513985.jpg', 48, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:55:08', 1);
INSERT INTO `pms_brand_company` VALUES (1006000, '范思哲制造商', '严选找寻意大利奢侈品牌范思哲Versace的制造商，\n致力于为用户带来精致、优雅、时尚的皮包，\n传承独特美感，体验品质生活。', '/images/brandcompany/20211025/20211025133513985.jpg', 18, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:55', 1);
INSERT INTO `pms_brand_company` VALUES (1008000, 'WPC制造商', '严选寻找日本雨伞品牌W.P.C制造商，\n采用严谨工艺以及环保材料，\n沉淀15年行业经验，打造精致雨具。', '/images/brandcompany/20211025/20211025133513985.jpg', 22, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:57', 1);
INSERT INTO `pms_brand_company` VALUES (1010001, '竹宝堂制造商', '严选走访河北、安徽等制刷基地，\n选定竹宝堂、丝芙兰等品牌的制造商，\n严格把关生产与质检，与您一同追求美的生活。', '/images/brandcompany/20211025/20211025133513985.jpg', 39, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:55:01', 1);
INSERT INTO `pms_brand_company` VALUES (1010002, '资生堂制造商', '发现美，成为美，是女性一生的追求。\n严选找寻资生堂代工厂，打造天然美妆产品，\n致力于带来更多美的体验和享受。', '/images/brandcompany/20211025/20211025133513985.jpg', 19, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:55:10', 1);
INSERT INTO `pms_brand_company` VALUES (1015000, 'NITORI制造商', '宠物是人类最温情的陪伴，\n严选找寻日本最大家居品牌NITORI制造商，\n每一个脚印，都是为了更好地关怀你的TA', '/images/brandcompany/20211025/20211025133513985.jpg', 43, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:55:12', 1);
INSERT INTO `pms_brand_company` VALUES (1016002, 'HUGO BOSS制造商', '严选深入德国知名奢侈品HUGO BOSS的制造商，\n开发睡衣、睡袍、休闲裤等轻奢品质家居服，\n希望你在家的每一天都优雅精致。', '/images/brandcompany/20211025/20211025133513985.jpg', 11, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:33', 1);
INSERT INTO `pms_brand_company` VALUES (1018000, 'Sperry制造商', '严选团队对比多家硫化鞋制造商产品质量，\n走访多个制鞋工厂，最终选定Sperry品牌制造商，\n为你提供一双舒适有型的高品质帆布鞋。', '/images/brandcompany/20211025/20211025133513985.jpg', 32, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:31', 1);
INSERT INTO `pms_brand_company` VALUES (1021000, 'Marc Jacobs制造商', '严选寻访独立设计品牌Marc Jacobs的制造商，\n严格选材，细究纺织与生产的细节，多次打磨，\n初心不忘，为你带来优雅高档的服饰配件。', '/images/brandcompany/20211025/20211025133513985.jpg', 24, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:29', 1);
INSERT INTO `pms_brand_company` VALUES (1022000, 'UGG制造商', '为寻找优质的皮毛一体雪地靴，\n严选走访多家雪地靴制造商，对比工艺，\n甄选UGG认可的代工厂，只为足下的优雅舒适。', '/images/brandcompany/20211025/20211025133513985.jpg', 29, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:27', 1);
INSERT INTO `pms_brand_company` VALUES (1022001, 'Palladium制造商', '严选探访多个制鞋大厂，选定Palladium制造商，\n对比工艺选材，找到传承多年的制鞋配方，\n只为制作一款高品质休闲鞋。', '/images/brandcompany/20211025/20211025133513985.jpg', 31, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:54:24', 1);
INSERT INTO `pms_brand_company` VALUES (1023000, 'PetitBateau小帆船制造商', '为打造适合宝宝的婴童服装，\n严选团队寻找PetitBateau小帆船的品牌制造商，\n无荧光剂，国家A类标准，让宝宝穿的放心。', '/images/brandcompany/20211025/20211025133513985.jpg', 25, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:53:26', 1);
INSERT INTO `pms_brand_company` VALUES (1024000, 'WMF制造商', '严选找寻德国百年高端厨具WMF的制造商，\n选择拥有14年经验的不锈钢生产工厂，\n为你甄选事半功倍的优质厨具。', '/images/brandcompany/20211025/20211025133513985.jpg', 8, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:52:20', 1);
INSERT INTO `pms_brand_company` VALUES (1024001, 'OBH制造商', '严选寻找OBH品牌的制造商，打造精致厨具，\n韩国独资工厂制造，严格质检，品质雕琢\n力求为消费者带来全新的烹饪体验。', '/images/brandcompany/20211025/20211025133513985.jpg', 42, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:45', 1);
INSERT INTO `pms_brand_company` VALUES (1024003, 'Stoneline制造商', '严选找寻德国经典品牌Stoneline的制造商，\n追踪工艺，考量细节，亲自试用，\n为你甄选出最合心意的锅具和陶瓷刀，下厨如神。', '/images/brandcompany/20211025/20211025133513985.jpg', 28, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:43', 1);
INSERT INTO `pms_brand_company` VALUES (1024006, 'KitchenAid制造商', '严选寻访KitchenAid品牌的制造商，\n采用德国LFGB认证食品级专用不锈钢，\n欧式简约设计，可靠安心，尽享下厨乐趣。', '/images/brandcompany/20211025/20211025133513985.jpg', 46, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:41', 1);
INSERT INTO `pms_brand_company` VALUES (1025000, 'Timberland制造商', '为制作优质时尚的工装鞋靴，\n严选团队深入探访国内外制靴大厂，选择Timberland制造商，\n工厂拥有15年制鞋历史，专业品质有保证。', '/images/brandcompany/20211025/20211025133513985.jpg', 37, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:39', 1);
INSERT INTO `pms_brand_company` VALUES (1025001, 'Kenneth Cole制造商', '为出品优质格调的商务鞋靴，\n严选团队选择Kenneth Cole品牌合作的制造商，\n一切努力，只为打造高品质鞋靴。', '/images/brandcompany/20211025/20211025133513985.jpg', 7, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:37', 1);
INSERT INTO `pms_brand_company` VALUES (1026000, 'CK制造商', '严选寻访Calvin Klein品牌的制造商，\n深入世界领带第一生产地，设计与品质并重，\n致力于给消费者带来优质典雅的服饰用品。', '/images/brandcompany/20211025/20211025133513985.jpg', 1, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:35', 1);
INSERT INTO `pms_brand_company` VALUES (1026001, 'Under Armour制造商', '严选为甄选优质好袜，走访东北、新疆等产袜基地，\n最终选定Under Armour品牌的合作制造商，\n从原料、工艺、品质多维度筛选监制，保证好品质。', '/images/brandcompany/20211025/20211025133513985.jpg', 35, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:33', 1);
INSERT INTO `pms_brand_company` VALUES (1028000, 'Gucci制造商', '严选为设计一款优雅时尚的品质礼帽，\n找寻拥有10来年经验的大型毛毡帽厂商合作，\n坚持打造好设计、好工艺、好材质的潮流礼帽。', '/images/brandcompany/20211025/20211025133513985.jpg', 23, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:31', 1);
INSERT INTO `pms_brand_company` VALUES (1028003, 'Burberry制造商', '为打造时尚舒适的童装系列，\n严选选择Burberry制造商，优化版型配色\n英伦风情融入经典格纹，百搭优雅气质款。', '/images/brandcompany/20211025/20211025133513985.jpg', 4, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:29', 1);
INSERT INTO `pms_brand_company` VALUES (1033003, 'Armani制造商', '严选团队携手国际标准化专业生产厂家，\n厂家长期为Armani、Alexander wang等知名品牌代工，\n专业进口设备，精密质量把控，精于品质居家体验。', '/images/brandcompany/20211025/20211025133513985.jpg', 26, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:27', 1);
INSERT INTO `pms_brand_company` VALUES (1033004, '爱马仕集团制造商', '严选采用欧洲一线品牌爱马仕的御用香料供应商，\n经过反复配比改良、试香调香、选品定样，\n为你带来独特馥郁的散香体验。', '/images/brandcompany/20211025/20211025133513985.jpg', 33, 1, '2020-05-05 10:43:35', 1, '2020-07-01 08:51:09', 1);
INSERT INTO `pms_brand_company` VALUES (1034001, 'Alexander McQueen制造商', '为制造精致实用的高品质包包，\n严选团队选择Alexander McQueen制造商，\n严格筛选，带来轻奢优雅体验。', '/images/brandcompany/20211025/20211025133513985.jpg', 16, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:19', 1);
INSERT INTO `pms_brand_company` VALUES (1037000, '厚木ATSUGI制造商', '严选考究袜子品质，层层把关原料生产，\n携手12年行业生产资质的厚木品牌制造商，\n带来轻盈优雅，舒适显瘦的袜子系列。', '/images/brandcompany/20211025/20211025133513985.jpg', 27, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:16', 1);
INSERT INTO `pms_brand_company` VALUES (1038000, 'Birkenstock集团制造商', '为打造一双舒适的软木拖鞋，\n严选团队寻找BIRKENSTOCK集团旗下产品制造商，\n360度全程监制，舒适随脚，百搭文艺。', '/images/brandcompany/20211025/20211025133513985.jpg', 14, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:13', 1);
INSERT INTO `pms_brand_company` VALUES (1038001, 'Nine West制造商', '为打造一双优雅舒适的高跟鞋，\n严选选择美国Nine West玖熙品牌的制造商，\n让美丽绽放在足尖。', '/images/brandcompany/20211025/20211025133513985.jpg', 13, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:10', 1);
INSERT INTO `pms_brand_company` VALUES (1039000, 'TEFAL制造商', '严选对标国际品质，致力于高品质生活好物，\n执着寻求优质厨房电器供应商，\n携手WMF、Tefal制造商，打造高品质厨具。', '/images/brandcompany/20211025/20211025133513985.jpg', 44, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:07', 1);
INSERT INTO `pms_brand_company` VALUES (1039001, '京瓷制造商', '严选想为你的厨房生活，带来新鲜感和活力，\n深入全国各地，选择日本京瓷等品牌代工厂，\n打造钻石系列厨具，颜值与品质兼具。', '/images/brandcompany/20211025/20211025133513985.jpg', 38, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:05', 1);
INSERT INTO `pms_brand_company` VALUES (1040000, 'Tescom制造商', '严选为打造时尚健康的个护电器，\n选择Tescom品牌制造商，全球最大个护电器工厂之一，\n拥有20年经验，出口180多个国家，品质有保障。', '/images/brandcompany/20211025/20211025133513985.jpg', 15, 1, '2020-05-05 10:43:35', 1, '2021-10-25 13:35:15', 1);
INSERT INTO `pms_brand_company` VALUES (1041000, 'BCBG制造商', '严选从产品源头开始，每道工序质量把关，\n选择美国知名品牌BCBG的制造商合作，\n严谨匠心，致力于优质柔滑的睡衣穿搭产品。', '/images/brandcompany/20211025/20211025133513985.jpg', 36, 1, '2020-05-05 10:43:35', 1, '2020-05-22 04:51:01', 1);
INSERT INTO `pms_brand_company` VALUES (1046000, 'Police制造商', '严选团队选定Police品牌制造商合作，\n有11年眼镜生产资质，兼顾品质与品味，\n为你带来专业时尚的墨镜。', '/images/brandcompany/20211025/20211025133513985.jpg', 6, 1, '2020-05-05 10:43:35', 1, '2020-07-01 08:52:16', 0);
